import React from "react";

import "./styles.css";
export default class Banner extends React.Component {
  render() {
    return (
      <section className="banner">
        <div className="count-down-area">
          <p className="count-down-area-text">ContDown Example</p>
          <div className="count-down-area-timer-up">
            <span>Days</span>
            <span>Hours</span>
            <span>Minutes</span>
            <span>Seconds</span>
          </div>
          <div className="count-down-area-timer">
            <span>365d</span>
            <span>365d</span>
            <span>365d</span>
            <span>365d</span>
          </div>
        </div>
      </section>
    );
  }
}
